{"nbformat":4,"nbformat_minor":0,"metadata":{"colab":{"provenance":[],"authorship_tag":"ABX9TyORCG1U6/UTiXXJF7lkVCdK"},"kernelspec":{"name":"python3","display_name":"Python 3"},"language_info":{"name":"python"}},"cells":[{"cell_type":"code","execution_count":9,"metadata":{"id":"zRtMInYxUyM9","executionInfo":{"status":"ok","timestamp":1761530259457,"user_tz":240,"elapsed":50,"user":{"displayName":"Derek Gallo","userId":"03745874976630683909"}}},"outputs":[],"source":["#Import libraries\n","import numpy as np\n","import sympy as sp\n","import matplotlib.pyplot as plt\n","x = sp.Symbol('x')\n","\n","\n","def taylor(func, start, end, degree, fixed_c):\n","    #Initialize list and set constant c\n","    approx = []\n","    c = fixed_c\n","\n","    #Iterate over 100 points between start and finish value\n","    for n in np.linspace(start,end,100):\n","        #Initialize variables per iteration\n","        value = 0\n","        f = func\n","\n","        #Perform the Taylor summation of i terms\n","        for i in range(degree):\n","            value += ((f.subs(x,c)) * (((n - c) ** i))) / sp.factorial(i)\n","\n","            #Take derivative for next iteration\n","            f = sp.diff(f,x)\n","\n","        #Add summation value to the list\n","        approx.append(value)\n","\n","    #Convert list to an array\n","    approx = np.array(approx)\n","    return approx"]},{"cell_type":"code","source":["#Run Taylor Approximation on the function\n","taylor_approx = taylor((x * (sp.sin(x) ** 2)) + sp.cos(x), -10, 10, 99, 0)\n","\n","#Find the actual values for the function\n","x = np.linspace(-10,10,100)\n","actual = (x * (np.sin(x) ** 2)) + np.cos(x)\n","\n","#Plot the Taylor Approximation and the actual function\n","plt.plot(x, taylor_approx, 'o',color = 'red', label = 'Taylor Approximation')\n","plt.plot(x, actual, color = 'blue', label = 'Actual')\n","plt.legend()\n","plt.xlabel('x')\n","plt.ylabel('xsin\\u00b2(x) + cos(x)')\n","plt.savefig('taylor.png')\n","plt.show()"],"metadata":{"colab":{"base_uri":"https://localhost:8080/","height":449},"id":"5Rlo0UWahQcs","executionInfo":{"status":"ok","timestamp":1761530261507,"user_tz":240,"elapsed":2048,"user":{"displayName":"Derek Gallo","userId":"03745874976630683909"}},"outputId":"5ea1dec0-6d65-4fe9-c4d0-abb6d17e8ba8"},"execution_count":10,"outputs":[{"output_type":"display_data","data":{"text/plain":["<Figure size 640x480 with 1 Axes>"],"image/png":"\n"},"metadata":{}}]},{"cell_type":"code","source":["#Import libraries\n","import numpy as np\n","import sympy as sp\n","import time\n","import pandas as pd\n","x = sp.Symbol('x')\n","\n","def taylor_factorial(func, start, end, degree, fixed_c, initial_degree, final_degree, degree_step):\n","    #Initialize variables and lists\n","    c = fixed_c\n","    Cutoff_Value = []\n","    Difference = []\n","    Time = []\n","    i = initial_degree\n","\n","    #Iterate according to the inital degree, final degree,\n","    #and degreee step values\n","    while i <= final_degree:\n","        #Initialize lists\n","        diff = []\n","        approx = []\n","        actual = []\n","\n","        #Start timer for approximation\n","        start_time = time.perf_counter()\n","        for _ in range(1000000):\n","            pass\n","\n","        #Calculate approximate value for 100 x-values between -10 and 10\n","        #And add to a list\n","        for n in np.linspace(start,end,100):\n","            value = 0\n","            f = func\n","            for j in range(i):\n","                value += ((f.subs(x,c)) * (((n - c) ** j))) / sp.factorial(j)\n","                f = sp.diff(f,x)\n","            approx.append(value)\n","\n","        #Make the list an array\n","        approx = np.array(approx)\n","\n","        #End timer after approximation is made and calculate elapsed time\n","        end_time = time.perf_counter()\n","        elapsed_time = end_time - start_time\n","\n","        #Calculate the actual values of the function and make it an array\n","        for n in np.linspace(start,end,100):\n","            actual.append((n * (np.sin(n) ** 2)) + np.cos(n))\n","        actual = np.array(actual)\n","\n","        #Take the sum of the absolute value of the differnce between the\n","        #approximate and the actual values\n","        diff = np.abs(approx - actual)\n","        diff = np.sum(diff)\n","\n","        #Add the iteration, sum of differences, and elasped time to a list\n","        Cutoff_Value.append(i)\n","        Difference.append(diff)\n","        Time.append(elapsed_time)\n","\n","        #Iterate to the next step degree\n","        i += degree_step\n","\n","    #Make the data a panda dataframe and save to a .csv file\n","    data = {'Cutoff value': Cutoff_Value, 'Difference': Difference, 'Time': Time}\n","    df = pd.DataFrame(data)\n","    df.to_csv(\"taylor_values.csv\", index = False)\n","    return print('Dataframe exported to taylor_values.csv')"],"metadata":{"id":"cxoQog_q8PsI","executionInfo":{"status":"ok","timestamp":1761530261510,"user_tz":240,"elapsed":2,"user":{"displayName":"Derek Gallo","userId":"03745874976630683909"}}},"execution_count":11,"outputs":[]},{"cell_type":"code","source":["taylor_factorial((x * (sp.sin(x) ** 2)) + sp.cos(x), -10, 10, 99, 0, 50, 100, 10)"],"metadata":{"colab":{"base_uri":"https://localhost:8080/"},"id":"ycJUaDRaWc-t","executionInfo":{"status":"ok","timestamp":1761530270312,"user_tz":240,"elapsed":8802,"user":{"displayName":"Derek Gallo","userId":"03745874976630683909"}},"outputId":"893fadbd-2eaf-420f-f860-286b3fcb5c56"},"execution_count":12,"outputs":[{"output_type":"stream","name":"stdout","text":["Dataframe exported to taylor_values.csv\n"]}]}]}